TypedDataset: Feature Overview
This tutorial introduces TypedDataset using a simple example.
The following imports are needed to make all code examples compile.
import org.apache.spark.{SparkConf, SparkContext}
import org.apache.spark.sql.SparkSession
import frameless.functions.aggregate._
import frameless.TypedDataset

val conf = new SparkConf().setMaster("local[*]").setAppName("frameless repl").set("spark.ui.enabled", "false")
val spark = SparkSession.builder().config(conf).appName("REPL").getOrCreate()
implicit val sqlContext = spark.sqlContext
spark.sparkContext.setLogLevel("WARN")

import spark.implicits._

Creating TypedDataset instances
We start by defining a case class:
case class Apartment(city: String, surface: Int, price: Double)

And few Apartment instances:
val apartments = Seq(
  Apartment("Paris", 50, 300000.0),
  Apartment("Paris", 100, 450000.0),
  Apartment("Paris", 25, 250000.0),
  Apartment("Lyon", 83, 200000.0),
  Apartment("Lyon", 45, 133000.0),
  Apartment("Nice", 74, 325000.0)
)

We are now ready to instantiate a TypedDataset[Apartment]:
val aptTypedDs = TypedDataset.create(apartments)
// aptTypedDs: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

We can also create one from an existing Spark Dataset:
val aptDs = spark.createDataset(apartments)
// aptDs: org.apache.spark.sql.Dataset[Apartment] = [city: string, surface: int ... 1 more field]

val aptTypedDs = TypedDataset.create(aptDs)
// aptTypedDs: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

Or use the Frameless syntax:
import frameless.syntax._
// import frameless.syntax._

val aptTypedDs2 = aptDs.typed
// aptTypedDs2: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

Typesafe column referencing
This is how we select a particular column from a TypedDataset:
val cities: TypedDataset[String] = aptTypedDs.select(aptTypedDs('city))
// cities: frameless.TypedDataset[String] = [_1: string]

This is completely type-safe, for instance suppose we misspell city as citi:
aptTypedDs.select(aptTypedDs('citi))
// :28: error: No column Symbol with shapeless.tag.Tagged[String("citi")] of type A in Apartment
//        aptTypedDs.select(aptTypedDs('citi))
//                                    ^

This gets raised at compile-time, whereas with the standard Dataset API the error appears at run-time (enjoy the stack trace):
aptDs.select('citi)
// org.apache.spark.sql.AnalysisException: cannot resolve '`citi`' given input columns: [city, surface, price];;
// 'Project ['citi]
// +- LocalRelation [city#206, surface#207, price#208]
// 
//   at org.apache.spark.sql.catalyst.analysis.package$AnalysisErrorAt.failAnalysis(package.scala:42)
//   at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1$$anonfun$apply$2.applyOrElse(CheckAnalysis.scala:77)
//   at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1$$anonfun$apply$2.applyOrElse(CheckAnalysis.scala:74)
//   at org.apache.spark.sql.catalyst.trees.TreeNode$$anonfun$transformUp$1.apply(TreeNode.scala:308)
//   at org.apache.spark.sql.catalyst.trees.TreeNode$$anonfun$transformUp$1.apply(TreeNode.scala:308)
//   at org.apache.spark.sql.catalyst.trees.CurrentOrigin$.withOrigin(TreeNode.scala:69)
//   at org.apache.spark.sql.catalyst.trees.TreeNode.transformUp(TreeNode.scala:307)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan.transformExpressionUp$1(QueryPlan.scala:269)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan.org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2(QueryPlan.scala:279)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan$$anonfun$org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2$1.apply(QueryPlan.scala:283)
//   at scala.collection.TraversableLike$$anonfun$map$1.apply(TraversableLike.scala:234)
//   at scala.collection.TraversableLike$$anonfun$map$1.apply(TraversableLike.scala:234)
//   at scala.collection.mutable.ResizableArray$class.foreach(ResizableArray.scala:59)
//   at scala.collection.mutable.ArrayBuffer.foreach(ArrayBuffer.scala:48)
//   at scala.collection.TraversableLike$class.map(TraversableLike.scala:234)
//   at scala.collection.AbstractTraversable.map(Traversable.scala:104)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan.org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2(QueryPlan.scala:283)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan$$anonfun$8.apply(QueryPlan.scala:288)
//   at org.apache.spark.sql.catalyst.trees.TreeNode.mapProductIterator(TreeNode.scala:186)
//   at org.apache.spark.sql.catalyst.plans.QueryPlan.transformExpressionsUp(QueryPlan.scala:288)
//   at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1.apply(CheckAnalysis.scala:74)
//   at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1.apply(CheckAnalysis.scala:67)
//   at org.apache.spark.sql.catalyst.trees.TreeNode.foreachUp(TreeNode.scala:126)
//   at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$class.checkAnalysis(CheckAnalysis.scala:67)
//   at org.apache.spark.sql.catalyst.analysis.Analyzer.checkAnalysis(Analyzer.scala:58)
//   at org.apache.spark.sql.execution.QueryExecution.assertAnalyzed(QueryExecution.scala:49)
//   at org.apache.spark.sql.Dataset$.ofRows(Dataset.scala:64)
//   at org.apache.spark.sql.Dataset.org$apache$spark$sql$Dataset$$withPlan(Dataset.scala:2603)
//   at org.apache.spark.sql.Dataset.select(Dataset.scala:969)
//   ... 458 elided

select() supports arbitrary column operations:
aptTypedDs.select(aptTypedDs('surface) * 10, aptTypedDs('surface) + 2).show().run()
// +----+---+
// |  _1| _2|
// +----+---+
// | 500| 52|
// |1000|102|
// | 250| 27|
// | 830| 85|
// | 450| 47|
// | 740| 76|
// +----+---+
//

Note that unlike the standard Spark API where some operations are lazy and some are not, TypedDatasets have all operations to be lazy. 
In the above example, show() is lazy. It requires to apply run() for the show job to materialize.
A more detailed explanation of Job is given here.
Next we compute the price by surface unit:
val priceBySurfaceUnit = aptTypedDs.select(aptTypedDs('price) / aptTypedDs('surface))
// :27: error: overloaded method value / with alternatives:
//   (u: Double)(implicit n: frameless.CatalystNumeric[Double])frameless.TypedColumn[Apartment,Double] 
//   (u: frameless.TypedColumn[Apartment,Double])(implicit n: frameless.CatalystNumeric[Double])frameless.TypedColumn[Apartment,Double]
//  cannot be applied to (frameless.TypedColumn[Apartment,Int])
//        val priceBySurfaceUnit = aptTypedDs.select(aptTypedDs('price) / aptTypedDs('surface))
//                                                                      ^

As the error suggests, we can't divide a TypedColumn of Double by Int. 
For safety, in Frameless only math operations between same types is allowed. 
There are two ways to proceed here: 
(a) Explicitly cast Int to Double (manual)
val priceBySurfaceUnit = aptTypedDs.select(aptTypedDs('price) / aptTypedDs('surface).cast[Double])
// priceBySurfaceUnit: frameless.TypedDataset[Double] = [_1: double]

priceBySurfaceUnit.collect().run()
// res6: Seq[Double] = WrappedArray(6000.0, 4500.0, 10000.0, 2409.6385542168673, 2955.5555555555557, 4391.891891891892)

(b) Perform the cast implicitly (automated)
import frameless.implicits.widen._
// import frameless.implicits.widen._

val priceBySurfaceUnit = aptTypedDs.select(aptTypedDs('price) / aptTypedDs('surface))
// priceBySurfaceUnit: frameless.TypedDataset[Double] = [_1: double]

priceBySurfaceUnit.collect.run()
// res7: Seq[Double] = WrappedArray(6000.0, 4500.0, 10000.0, 2409.6385542168673, 2955.5555555555557, 4391.891891891892)

Looks like it worked, but that cast seems unsafe right? Actually it is safe.
Let's try to cast a TypedColumn of String to Double:
aptTypedDs('city).cast[Double]
// :31: error: could not find implicit value for parameter c: frameless.CatalystCast[String,Double]
//        aptTypedDs('city).cast[Double]
//                              ^

The compile-time error tells us that to perform the cast, an evidence 
(in the form of CatalystCast[String, Double]) must be available. 
Since casting from String to Double is not allowed, this results 
in a compilation error. 
Check here 
for the set of available CatalystCast.
TypeSafe TypedDataset casting and projections
With select() the resulting TypedDataset is of type TypedDataset[TupleN[...]] (with N in [1...10]).
For example, if we select three columns with types String, Int, and Boolean the result will have type
TypedDataset[(String, Int, Boolean)]. To select more than ten columns use the selectMany() method. 
Select has better IDE support than the macro based selectMany, so prefer select() for the general case. 
We often want to give more expressive types to the result of our computations.
as[T] allows us to safely cast a TypedDataset[U] to another of type TypedDataset[T] as long
as the types in U and T align.
When the cast is valid the expression compiles:
case class UpdatedSurface(city: String, surface: Int)
// defined class UpdatedSurface

val updated = aptTypedDs.select(aptTypedDs('city), aptTypedDs('surface) + 2).as[UpdatedSurface]
// updated: frameless.TypedDataset[UpdatedSurface] = [city: string, surface: int]

updated.show(2).run()
// +-----+-------+
// | city|surface|
// +-----+-------+
// |Paris|     52|
// |Paris|    102|
// +-----+-------+
// only showing top 2 rows
//

Next we try to cast a (String, String) to an UpdatedSurface (which has types String, Int).
The cast is not valid and the expression does not compile:
aptTypedDs.select(aptTypedDs('city), aptTypedDs('city)).as[UpdatedSurface]
// :33: error: could not find implicit value for parameter as: frameless.ops.As[(String, String),UpdatedSurface]
//        aptTypedDs.select(aptTypedDs('city), aptTypedDs('city)).as[UpdatedSurface]
//                                                                  ^

Projections
We often want to work with a subset of the fields in a dataset.
Projections allows to easily select the fields we are interested
while preserving their initial name and types for extra safety.
Here is an example using the TypedDataset[Apartment] with an additional column:
import frameless.implicits.widen._
// import frameless.implicits.widen._

val aptds = aptTypedDs // For shorter expressions
// aptds: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

case class ApartmentDetails(city: String, price: Double, surface: Int, ratio: Double)
// defined class ApartmentDetails

val aptWithRatio = aptds.select(aptds('city), aptds('price), aptds('surface), aptds('price) / aptds('surface)).as[ApartmentDetails]
// aptWithRatio: frameless.TypedDataset[ApartmentDetails] = [city: string, price: double ... 2 more fields]

Suppose we only want to work with city and ratio:
case class CityInfo(city: String, ratio: Double)
// defined class CityInfo

val cityRatio = aptWithRatio.project[CityInfo]
// cityRatio: frameless.TypedDataset[CityInfo] = [city: string, ratio: double]

cityRatio.show(2).run()
// +-----+------+
// | city| ratio|
// +-----+------+
// |Paris|6000.0|
// |Paris|4500.0|
// +-----+------+
// only showing top 2 rows
//

Suppose we only want to work with price and ratio:
case class PriceInfo(ratio: Double, price: Double)
// defined class PriceInfo

val priceInfo = aptWithRatio.project[PriceInfo]
// priceInfo: frameless.TypedDataset[PriceInfo] = [ratio: double, price: double]

priceInfo.show(2).run()
// +------+--------+
// | ratio|   price|
// +------+--------+
// |6000.0|300000.0|
// |4500.0|450000.0|
// +------+--------+
// only showing top 2 rows
//

We see that the order of the fields does not matter as long as the
names and the corresponding types agree. However, if we make a mistake in
any of the names and/or their types, then we get a compilation error.
Say we make a typo in a field name:
case class PriceInfo2(ratio: Double, pricEE: Double)

aptWithRatio.project[PriceInfo2]
// :36: error: Cannot prove that ApartmentDetails can be projected to PriceInfo2. Perhaps not all member names and types of PriceInfo2 are the same in ApartmentDetails?
//        aptWithRatio.project[PriceInfo2]
//                            ^

Say we make a mistake in the corresponding type:
case class PriceInfo3(ratio: Int, price: Double) // ratio should be Double

aptWithRatio.project[PriceInfo3]
// :36: error: Cannot prove that ApartmentDetails can be projected to PriceInfo3. Perhaps not all member names and types of PriceInfo3 are the same in ApartmentDetails?
//        aptWithRatio.project[PriceInfo3]
//                            ^

User Defined Functions
Frameless supports lifting any Scala function (up to five arguments) to the
context of a particular TypedDataset:
// The function we want to use as UDF
val priceModifier =
    (name: String, price:Double) => if(name == "Paris") price * 2.0 else price
// priceModifier: (String, Double) => Double = 

val udf = aptTypedDs.makeUDF(priceModifier)
// udf: (frameless.TypedColumn[Apartment,String], frameless.TypedColumn[Apartment,Double]) => frameless.TypedColumn[Apartment,Double] = 

val aptds = aptTypedDs // For shorter expressions
// aptds: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

val adjustedPrice = aptds.select(aptds('city), udf(aptds('city), aptds('price)))
// adjustedPrice: frameless.TypedDataset[(String, Double)] = [_1: string, _2: double]

adjustedPrice.show().run()
// +-----+--------+
// |   _1|      _2|
// +-----+--------+
// |Paris|600000.0|
// |Paris|900000.0|
// |Paris|500000.0|
// | Lyon|200000.0|
// | Lyon|133000.0|
// | Nice|325000.0|
// +-----+--------+
//

GroupBy and Aggregations
Let's suppose we wanted to retrieve the average apartment price in each city
val priceByCity = aptTypedDs.groupBy(aptTypedDs('city)).agg(avg(aptTypedDs('price)))
// priceByCity: frameless.TypedDataset[(String, Double)] = [_1: string, _2: double]

priceByCity.collect().run()
// res17: Seq[(String, Double)] = WrappedArray((Nice,325000.0), (Paris,333333.3333333333), (Lyon,166500.0))

Again if we try to aggregate a column that can't be aggregated, we get a compilation error
aptTypedDs.groupBy(aptTypedDs('city)).agg(avg(aptTypedDs('city)))                                                         ^
// :34: error: could not find implicit value for parameter averageable: frameless.CatalystAverageable[String,Out]
//        aptTypedDs.groupBy(aptTypedDs('city)).agg(avg(aptTypedDs('city)))                                                         ^
//                                                     ^
// :34: warning: postfix operator ^ should be enabled
// by making the implicit value scala.language.postfixOps visible.
// This can be achieved by adding the import clause 'import scala.language.postfixOps'
// or by setting the compiler option -language:postfixOps.
// See the Scaladoc for value scala.language.postfixOps for a discussion
// why the feature should be explicitly enabled.
//        aptTypedDs.groupBy(aptTypedDs('city)).agg(avg(aptTypedDs('city)))                                                         ^
//                                                                                                                                  ^

Next, we combine select and groupBy to calculate the average price/surface ratio per city:
val aptds = aptTypedDs // For shorter expressions
// aptds: frameless.TypedDataset[Apartment] = [city: string, surface: int ... 1 more field]

val cityPriceRatio =  aptds.select(aptds('city), aptds('price) / aptds('surface))
// cityPriceRatio: frameless.TypedDataset[(String, Double)] = [_1: string, _2: double]

cityPriceRatio.groupBy(cityPriceRatio('_1)).agg(avg(cityPriceRatio('_2))).show().run()
// +-----+------------------+
// |   _1|                _2|
// +-----+------------------+
// | Nice| 4391.891891891892|
// |Paris| 6833.333333333333|
// | Lyon|2682.5970548862115|
// +-----+------------------+
//

Entire TypedDataset Aggregation
We often want to aggregate the entire TypedDataset and skip the groupBy() clause.
In Frameless you can do this using the agg() operator directly on the TypedDataset. 
In the following example, we compute the average price, the average surface,the minimum surface, and the set of cities for the entire dataset. 
case class Stats(
   avgPrice: Double, 
   avgSurface: Double, 
   minSurface: Int, 
   allCities: Vector[String])
// defined class Stats

aptds.agg(
   avg(aptds('price)), 
   avg(aptds('surface)),
   min(aptds('surface)),
   collectSet(aptds('city))
).as[Stats].show().run() 
// +-----------------+------------------+----------+-------------------+
// |         avgPrice|        avgSurface|minSurface|          allCities|
// +-----------------+------------------+----------+-------------------+
// |276333.3333333333|62.833333333333336|        25|[Paris, Nice, Lyon]|
// +-----------------+------------------+----------+-------------------+
//

Joins
case class CityPopulationInfo(name: String, population: Int)

val cityInfo = Seq(
  CityPopulationInfo("Paris", 2229621),
  CityPopulationInfo("Lyon", 500715),
  CityPopulationInfo("Nice", 343629)
)

val citiInfoTypedDS = TypedDataset.create(cityInfo)

Here is how to join the population information to the apartment's dataset.
val withCityInfo = aptTypedDs.join(citiInfoTypedDS, aptTypedDs('city), citiInfoTypedDS('name))
// withCityInfo: frameless.TypedDataset[(Apartment, CityPopulationInfo)] = [_1: struct, _2: struct]

withCityInfo.show().run()
// +--------------------+---------------+
// |                  _1|             _2|
// +--------------------+---------------+
// | [Paris,50,300000.0]|[Paris,2229621]|
// |[Paris,100,450000.0]|[Paris,2229621]|
// | [Paris,25,250000.0]|[Paris,2229621]|
// |  [Lyon,83,200000.0]|  [Lyon,500715]|
// |  [Lyon,45,133000.0]|  [Lyon,500715]|
// |  [Nice,74,325000.0]|  [Nice,343629]|
// +--------------------+---------------+
//

The joined TypedDataset has type TypedDataset[(Apartment, CityPopulationInfo)].
We can then select which information we want to continue to work with:
case class AptPriceCity(city: String, aptPrice: Double, cityPopulation: Int)
// defined class AptPriceCity

withCityInfo.select(
   withCityInfo.colMany('_2, 'name), withCityInfo.colMany('_1, 'price), withCityInfo.colMany('_2, 'population)
).as[AptPriceCity].show().run
// +-----+--------+--------------+
// | city|aptPrice|cityPopulation|
// +-----+--------+--------------+
// |Paris|300000.0|       2229621|
// |Paris|450000.0|       2229621|
// |Paris|250000.0|       2229621|
// | Lyon|200000.0|        500715|
// | Lyon|133000.0|        500715|
// | Nice|325000.0|        343629|
// +-----+--------+--------------+
//

TypedDatasetVsSparkDataset.html.body:
Comparing TypedDatasets with Spark's Datasets
Goal:
  This tutorial compares the standard Spark Datasets api with the one provided by
  frameless' TypedDataset. It shows how TypedDatsets allows for an expressive and
  type-safe api with no compromises on performance.
For this tutorial we first create a simple dataset and save it on disk as a parquet file.
Parquet is a popular columnar format and well supported by Spark.
It's important to note that when operating on parquet datasets, Spark knows that each column is stored
separately, so if we only need a subset of the columns Spark will optimize for this and avoid reading
the entire dataset. This is a rather simplistic view of how Spark and parquet work together but it
will serve us well for the context of this discussion.
import spark.implicits._
// import spark.implicits._

// Our example case class Foo acting here as a schema
case class Foo(i: Long, j: String)
// defined class Foo

// Assuming spark is loaded and SparkSession is bind to spark
val initialDs = spark.createDataset( Foo(1, "Q") :: Foo(10, "W") :: Foo(100, "E") :: Nil )
// initialDs: org.apache.spark.sql.Dataset[Foo] = [i: bigint, j: string]

// Assuming you are on Linux or Mac OS
initialDs.write.parquet("/tmp/foo")

val ds = spark.read.parquet("/tmp/foo").as[Foo]
// ds: org.apache.spark.sql.Dataset[Foo] = [i: bigint, j: string]

ds.show()
// +---+---+
// |  i|  j|
// +---+---+
// |100|  E|
// |  1|  Q|
// | 10|  W|
// +---+---+
//

The value ds holds the content of the initialDs read from a parquet file.
Let's try to only use field i from Foo and see how Spark's Catalyst (the query optimizer)
optimizes this.
// Using a standard Spark TypedColumn in select()
val filteredDs = ds.filter($"i" === 10).select($"i".as[Long])
// filteredDs: org.apache.spark.sql.Dataset[Long] = [i: bigint]

filteredDs.show()
// +---+
// |  i|
// +---+
// | 10|
// +---+
//

The filteredDs is of type Dataset[Long]. Since we only access field i from Foo the type is correct.
Unfortunately, this syntax requires handholding by explicitly setting the TypedColumn in the select statement
to return type Long (look at the as[Long] statement). We will discuss this limitation next in more detail.
Now, let's take a quick look at the optimized Physical Plan that Spark's Catalyst generated.
filteredDs.explain()
// == Physical Plan ==
// *Project [i#69L]
// +- *Filter (isnotnull(i#69L) && (i#69L = 10))
//    +- *BatchedScan parquet [i#69L] Format: ParquetFormat, InputPaths: file:/tmp/foo, PartitionFilters: [], PushedFilters: [IsNotNull(i), EqualTo(i,10)], ReadSchema: struct

The last line is very important (see ReadSchema). The schema read
from the parquet file only required reading column i without needing to access column j.
This is great! We have both an optimized query plan and type-safety!
Unfortunately, this syntax is not bulletproof: it fails at run-time if we try to access
a non existing column x:
scala> ds.filter($"i" === 10).select($"x".as[Long])
org.apache.spark.sql.AnalysisException: cannot resolve '`x`' given input columns: [i, j];;
'Project ['x]
+- Filter (i#69L = cast(10 as bigint))
   +- Relation[i#69L,j#70] parquet

  at org.apache.spark.sql.catalyst.analysis.package$AnalysisErrorAt.failAnalysis(package.scala:42)
  at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1$$anonfun$apply$2.applyOrElse(CheckAnalysis.scala:77)
  at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1$$anonfun$apply$2.applyOrElse(CheckAnalysis.scala:74)
  at org.apache.spark.sql.catalyst.trees.TreeNode$$anonfun$transformUp$1.apply(TreeNode.scala:308)
  at org.apache.spark.sql.catalyst.trees.TreeNode$$anonfun$transformUp$1.apply(TreeNode.scala:308)
  at org.apache.spark.sql.catalyst.trees.CurrentOrigin$.withOrigin(TreeNode.scala:69)
  at org.apache.spark.sql.catalyst.trees.TreeNode.transformUp(TreeNode.scala:307)
  at org.apache.spark.sql.catalyst.plans.QueryPlan.transformExpressionUp$1(QueryPlan.scala:269)
  at org.apache.spark.sql.catalyst.plans.QueryPlan.org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2(QueryPlan.scala:279)
  at org.apache.spark.sql.catalyst.plans.QueryPlan$$anonfun$org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2$1.apply(QueryPlan.scala:283)
  at scala.collection.TraversableLike$$anonfun$map$1.apply(TraversableLike.scala:234)
  at scala.collection.TraversableLike$$anonfun$map$1.apply(TraversableLike.scala:234)
  at scala.collection.immutable.List.foreach(List.scala:392)
  at scala.collection.TraversableLike$class.map(TraversableLike.scala:234)
  at scala.collection.immutable.List.map(List.scala:296)
  at org.apache.spark.sql.catalyst.plans.QueryPlan.org$apache$spark$sql$catalyst$plans$QueryPlan$$recursiveTransform$2(QueryPlan.scala:283)
  at org.apache.spark.sql.catalyst.plans.QueryPlan$$anonfun$8.apply(QueryPlan.scala:288)
  at org.apache.spark.sql.catalyst.trees.TreeNode.mapProductIterator(TreeNode.scala:186)
  at org.apache.spark.sql.catalyst.plans.QueryPlan.transformExpressionsUp(QueryPlan.scala:288)
  at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1.apply(CheckAnalysis.scala:74)
  at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$$anonfun$checkAnalysis$1.apply(CheckAnalysis.scala:67)
  at org.apache.spark.sql.catalyst.trees.TreeNode.foreachUp(TreeNode.scala:126)
  at org.apache.spark.sql.catalyst.analysis.CheckAnalysis$class.checkAnalysis(CheckAnalysis.scala:67)
  at org.apache.spark.sql.catalyst.analysis.Analyzer.checkAnalysis(Analyzer.scala:58)
  at org.apache.spark.sql.execution.QueryExecution.assertAnalyzed(QueryExecution.scala:49)
  at org.apache.spark.sql.Dataset.(Dataset.scala:161)
  at org.apache.spark.sql.Dataset.(Dataset.scala:167)
  at org.apache.spark.sql.Dataset.select(Dataset.scala:1023)
  ... 450 elided

There are two things to improve here. First, we would want to avoid the at[Long] casting that we are required
to type for type-safety. This is clearly an area where we can introduce a bug by casting to an incompatible
type. Second, we want a solution where reference to a
non existing column name fails at compilation time.
The standard Spark Dataset can achieve this using the following syntax.
ds.filter(_.i == 10).map(_.i).show()
// +-----+
// |value|
// +-----+
// |   10|
// +-----+
//

This looks great! It reminds us the familiar syntax from Scala.
The two closures in filter and map are functions that operate on Foo and the
compiler will helps us capture all the mistakes we mentioned above.
scala> ds.filter(_.i == 10).map(_.x).show()
:20: error: value x is not a member of Foo
       ds.filter(_.i == 10).map(_.x).show()
                                  ^

Unfortunately, this syntax does not allow Spark to optimize the code.
ds.filter(_.i == 10).map(_.i).explain()
// == Physical Plan ==
// *SerializeFromObject [input[0, bigint, true] AS value#105L]
// +- *MapElements , obj#104: bigint
//    +- *DeserializeToObject newInstance(class $line14.$read$$iw$$iw$$iw$$iw$Foo), obj#103: $line14.$read$$iw$$iw$$iw$$iw$Foo
//       +- *Filter .apply
//          +- *BatchedScan parquet [i#69L,j#70] Format: ParquetFormat, InputPaths: file:/tmp/foo, PartitionFilters: [], PushedFilters: [], ReadSchema: struct

As we see from the explained Physical Plan, Spark was not able to optimize our query as before.
Reading the parquet file will required loading all the fields of Foo. This might be ok for
small datasets or for datasets with few columns, but will be extremely slow for most practical
applications.
Intuitively, Spark currently doesn't have a way to look inside the code we pass in these two
closures. It only knows that they both take one argument of type Foo, but it has no way of knowing if
we use just one or all of Foo's fields.
The TypedDataset in frameless solves this problem. It allows for a simple and type-safe syntax
with a fully optimized query plan.
import frameless.TypedDataset
// import frameless.TypedDataset

val fds = TypedDataset.create(ds)
// fds: frameless.TypedDataset[Foo] = [i: bigint, j: string]

fds.filter( fds('i) === 10 ).select( fds('i) ).show().run()
// +---+
// | _1|
// +---+
// | 10|
// +---+
//

And the optimized Physical Plan:
fds.filter( fds('i) === 10 ).select( fds('i) ).explain()
// == Physical Plan ==
// *Project [i#69L AS _1#176L]
// +- *Filter (isnotnull(i#69L) && (i#69L = 10))
//    +- *BatchedScan parquet [i#69L] Format: ParquetFormat, InputPaths: file:/tmp/foo, PartitionFilters: [], PushedFilters: [IsNotNull(i), EqualTo(i,10)], ReadSchema: struct

And the compiler is our friend.
scala> fds.filter( fds('i) === 10 ).select( fds('x) )
:21: error: No column Symbol with shapeless.tag.Tagged[String("x")] of type A in Foo
       fds.filter( fds('i) === 10 ).select( fds('x) )
                                               ^

Differences in Encoders
Encoders in Spark's Datasets are partially type-safe. If you try to create a Dataset using  a type that is not 
 a Scala Product then you get a compilation error:
class Bar(i: Int)
// defined class Bar

Bar is neither a case class nor a Product, so the following correctly gives a compilation error in Spark:
scala> spark.createDataset(Seq(new Bar(1)))
:21: error: Unable to find encoder for type stored in a Dataset.  Primitive types (Int, String, etc) and Product types (case classes) are supported by importing spark.implicits._  Support for serializing other types will be added in future releases.
       spark.createDataset(Seq(new Bar(1)))
                          ^

However, the compile type guards implemented in Spark are not sufficient to detect non encodable members. 
For example, using the following case class leads to a runtime failure:
case class MyDate(jday: java.util.Date)
// defined class MyDate

val myDateDs = spark.createDataset(Seq(MyDate(new java.util.Date(System.currentTimeMillis))))
// java.lang.UnsupportedOperationException: No Encoder found for java.util.Date
// - field (class: "java.util.Date", name: "jday")
// - root class: "MyDate"
//   at org.apache.spark.sql.catalyst.ScalaReflection$.org$apache$spark$sql$catalyst$ScalaReflection$$serializerFor(ScalaReflection.scala:598)
//   at org.apache.spark.sql.catalyst.ScalaReflection$$anonfun$9.apply(ScalaReflection.scala:592)
//   at org.apache.spark.sql.catalyst.ScalaReflection$$anonfun$9.apply(ScalaReflection.scala:583)
//   at scala.collection.TraversableLike$$anonfun$flatMap$1.apply(TraversableLike.scala:241)
//   at scala.collection.TraversableLike$$anonfun$flatMap$1.apply(TraversableLike.scala:241)
//   at scala.collection.immutable.List.foreach(List.scala:392)
//   at scala.collection.TraversableLike$class.flatMap(TraversableLike.scala:241)
//   at scala.collection.immutable.List.flatMap(List.scala:355)
//   at org.apache.spark.sql.catalyst.ScalaReflection$.org$apache$spark$sql$catalyst$ScalaReflection$$serializerFor(ScalaReflection.scala:583)
//   at org.apache.spark.sql.catalyst.ScalaReflection$.serializerFor(ScalaReflection.scala:425)
//   at org.apache.spark.sql.catalyst.encoders.ExpressionEncoder$.apply(ExpressionEncoder.scala:61)
//   at org.apache.spark.sql.Encoders$.product(Encoders.scala:274)
//   at org.apache.spark.sql.SQLImplicits.newProductEncoder(SQLImplicits.scala:47)
//   ... 770 elided

In comparison, a TypedDataset will notify about the encoding problem at compile time: 
TypedDataset.create(Seq(MyDate(new java.util.Date(System.currentTimeMillis))))
// :22: error: could not find implicit value for parameter encoder: frameless.TypedEncoder[MyDate]
//        TypedDataset.create(Seq(MyDate(new java.util.Date(System.currentTimeMillis))))
//                           ^

Injection.html.body:
Injection: Creating Custom Encoders
Injection lets us define encoders for types that do not have one by injecting A into an encodable type B.
This is the definition of the injection typeclass:
trait Injection[A, B] extends Serializable {
  def apply(a: A): B
  def invert(b: B): A
}

Example
Let's define a simple case class:
case class Person(age: Int, birthday: java.util.Date)
// defined class Person

val people = Seq(Person(42, new java.util.Date))
// people: Seq[Person] = List(Person(42,Tue May 23 10:57:10 CEST 2017))

And an instance of a TypedDataset:
val personDS = TypedDataset.create(people)
// :24: error: could not find implicit value for parameter encoder: frameless.TypedEncoder[Person]
//        val personDS = TypedDataset.create(people)
//                                          ^

Looks like we can't, a TypedEncoder instance of Person is not available, or more precisely for java.util.Date.
But we can define a injection from java.util.Date to an encodable type, like Long:
import frameless._
// import frameless._

implicit val dateToLongInjection = new Injection[java.util.Date, Long] {
  def apply(d: java.util.Date): Long = d.getTime()
  def invert(l: Long): java.util.Date = new java.util.Date(l)
}
// dateToLongInjection: frameless.Injection[java.util.Date,Long] = $anon$1@6d6cc4bc

We can be less verbose using the Injection.apply function:
import frameless._
// import frameless._

implicit val dateToLongInjection = Injection((_: java.util.Date).getTime(), new java.util.Date((_: Long)))
// dateToLongInjection: frameless.Injection[java.util.Date,Long] = frameless.Injection$$anon$1@79ea3da5

Now we can create our TypedDataset:
val personDS = TypedDataset.create(people)
// personDS: frameless.TypedDataset[Person] = [age: int, birthday: bigint]

Another example
Let's define a sealed family:
sealed trait Gender
// defined trait Gender

case object Male extends Gender
// defined object Male

case object Female extends Gender
// defined object Female

case object Other extends Gender
// defined object Other

And a simple case class:
case class Person(age: Int, gender: Gender)
// defined class Person

val people = Seq(Person(42, Male))
// people: Seq[Person] = List(Person(42,Male))

Again if we try to create a TypedDataset, we get a compilation error.
val personDS = TypedDataset.create(people)
// :32: error: could not find implicit value for parameter encoder: frameless.TypedEncoder[Person]
//        val personDS = TypedDataset.create(people)
//                                          ^

Let's define an injection instance for Gender:
implicit val genderToInt: Injection[Gender, Int] = Injection(
  {
    case Male   => 1
    case Female => 2
    case Other  => 3
  },
  {
    case 1 => Male
    case 2 => Female
    case 3 => Other
  })
// genderToInt: frameless.Injection[Gender,Int] = frameless.Injection$$anon$1@70fdc07e

And now we can create our TypedDataset:
val personDS = TypedDataset.create(people)
// personDS: frameless.TypedDataset[Person] = [age: int, gender: int]

Cats.html.body:
Using Cats with RDDs
Data aggregation is one of the most important operations when working with Spark (and data in general).
For example, we often have to compute the min, max, avg, etc. from a set of columns grouped by
different predicates. This section shows how cats simplifies these tasks in Spark by
leveraging a large collection of Type Classes for ordering and aggregating data.
All the examples below assume you have previously imported cats.implicits.
import cats.implicits._
// import cats.implicits._

Cats offers ways to sort and aggregate tuples of arbitrary arity.
import frameless.cats.implicits._
// import frameless.cats.implicits._

val data: RDD[(Int, Int, Int)] = sc.makeRDD((1, 2, 3) :: (1, 5, 3) :: (8, 2, 3) :: Nil)
// data: org.apache.spark.rdd.RDD[(Int, Int, Int)] = ParallelCollectionRDD[0] at makeRDD at :21

println(data.csum)
// (10,9,9)

println(data.cmax)
// (8,2,3)

println(data.cmin)
// (1,2,3)

The following example aggregates all the elements with a common key.
type User = String
// defined type alias User

type TransactionCount = Int
// defined type alias TransactionCount

val allData: RDD[(User,TransactionCount)] =
   sc.makeRDD(("Bob", 12) :: ("Joe", 1) :: ("Anna", 100) :: ("Bob", 20) :: ("Joe", 2) :: Nil)
// allData: org.apache.spark.rdd.RDD[(User, TransactionCount)] = ParallelCollectionRDD[1] at makeRDD at :24

val totalPerUser =  allData.csumByKey
// totalPerUser: org.apache.spark.rdd.RDD[(User, TransactionCount)] = ShuffledRDD[2] at reduceByKey at implicits.scala:18

totalPerUser.collectAsMap
// res7: scala.collection.Map[User,TransactionCount] = Map(Bob -> 32, Joe -> 3, Anna -> 100)

The same example would work for more complex keys.
val allDataComplexKeu =
   sc.makeRDD( ("Bob", Map("task1" -> 10)) ::
    ("Joe", Map("task1" -> 1, "task2" -> 3)) :: ("Bob", Map("task1" -> 10, "task2" -> 1)) :: ("Joe", Map("task3" -> 4)) :: Nil )
// allDataComplexKeu: org.apache.spark.rdd.RDD[(String, scala.collection.immutable.Map[String,Int])] = ParallelCollectionRDD[3] at makeRDD at :22

val overalTasksPerUser = allDataComplexKeu.csumByKey
// overalTasksPerUser: org.apache.spark.rdd.RDD[(String, scala.collection.immutable.Map[String,Int])] = ShuffledRDD[4] at reduceByKey at implicits.scala:18

overalTasksPerUser.collectAsMap
// res8: scala.collection.Map[String,scala.collection.immutable.Map[String,Int]] = Map(Bob -> Map(task1 -> 20, task2 -> 1), Joe -> Map(task1 -> 1, task2 -> 3, task3 -> 4))

Joins
// Type aliases for meaningful types
type TimeSeries = Map[Int,Int]
// defined type alias TimeSeries

type UserName = String
// defined type alias UserName

Example: Using the implicit full-our-join operator
import frameless.cats.outer._
// import frameless.cats.outer._

val day1: RDD[(UserName,TimeSeries)] = sc.makeRDD( ("John", Map(0 -> 2, 1 -> 4)) :: ("Chris", Map(0 -> 1, 1 -> 2)) :: ("Sam", Map(0 -> 1)) :: Nil )
// day1: org.apache.spark.rdd.RDD[(UserName, TimeSeries)] = ParallelCollectionRDD[5] at makeRDD at :26

val day2: RDD[(UserName,TimeSeries)] = sc.makeRDD( ("John", Map(0 -> 10, 1 -> 11)) :: ("Chris", Map(0 -> 1, 1 -> 2)) :: ("Joe", Map(0 -> 1, 1 -> 2)) :: Nil )
// day2: org.apache.spark.rdd.RDD[(UserName, TimeSeries)] = ParallelCollectionRDD[6] at makeRDD at :26

val daysCombined = day1 |+| day2
// daysCombined: org.apache.spark.rdd.RDD[(UserName, TimeSeries)] = MapPartitionsRDD[10] at mapValues at implicits.scala:43

daysCombined.collect()
// res10: Array[(UserName, TimeSeries)] = Array((Joe,Map(0 -> 1, 1 -> 2)), (Sam,Map(0 -> 1)), (Chris,Map(0 -> 2, 1 -> 4)), (John,Map(0 -> 12, 1 -> 15)))

Note how the user's timeseries from different days have been aggregated together.
The |+| (Semigroup) operator for key-value pair RDD will execute a full-outer-join
on the key and combine values using the default Semigroup for the value type.
In cats:
Map(1 -> 2, 2 -> 3) |+| Map(1 -> 4, 2 -> -1)
// res11: Map[Int,Int] = Map(1 -> 6, 2 -> 2)
